import React, { useState } from 'react';

const QGIS = ({ onBack }) => {
    const [isChecked, setIsChecked] = useState(false); // State to track checkbox
    const [errorMessage, setErrorMessage] = useState(''); // State for error message

    const handleCheckboxChange = () => {
        setIsChecked(!isChecked); // Toggle checkbox state
        setErrorMessage(''); // Clear error message when checkbox changes
    };

    const handleD3Redirect = () => {
        if (!isChecked) {
            setErrorMessage('Please confirm you have submitted the QGIS questionnaire before proceeding.'); // Set error message
        } else {
            onBack(); // Go to D3 React App
        }
    };

    return (
        <div style={{ textAlign: 'center', padding: '20px' }}>
            <h1>QGIS Map</h1>
            <p>Here is the data visualization, enjoy your time before decided to Go to QGIS Questionnaire!</p>
            {/* Display your QGIS images here */}
            <img src="hrv.png" alt="QGIS Example 1" style={{ width: '450px', margin: '5px' }} />
            <img src="stress.png" alt="QGIS Example 2" style={{ width: '450px', margin: '5px' }} />
            <img src="hrv.png" alt="QGIS Example 1" style={{ width: '450px', margin: '5px' }} />
            <img src="stress.png" alt="QGIS Example 2" style={{ width: '450px', margin: '5px' }} />
            {/* Add more images as needed */}
            <br />

            {/* Checkbox to confirm submission */}
            <div style={{ margin: '20px' }}>
                <input
                    type="checkbox"
                    checked={isChecked}
                    onChange={handleCheckboxChange}
                />
                <label style={{ marginLeft: '5px' }}>
                    I have finished and submitted the QGIS questionnaire in the Google Form
                </label>
            </div>

            {errorMessage && <p style={{ color: 'red' }}>{errorMessage}</p>} {/* Display error message */}

            <a href="https://forms.gle/hNiaZBJKq7en76wB7" target="_blank" rel="noopener noreferrer">
                <button className="qgis-que" style={{ margin: '5px', padding: '10px 20px' }}>
                    Go to QGIS Questionnaire
                </button>
            </a>

            <button
                onClick={handleD3Redirect} // Function for redirecting
                className="qgis-back"
                style={{ margin: '5px', padding: '10px 20px' }} // Same styling as above
            >
                Go to D3-React App
            </button>
        </div>
    );
};

export default QGIS;
